CREATE TABLE IF NOT EXISTS `RIDESCOM`.`Email` (
  `ID_Email` INT NOT NULL AUTO_INCREMENT,
  `Correo` VARCHAR(45) NOT NULL,
  `Contacto_ID_Contacto` INT NOT NULL,
  PRIMARY KEY (`ID_Email`),
  CONSTRAINT `fk_Email_Contacto1`
    FOREIGN KEY (`Contacto_ID_Contacto`)
    REFERENCES `RIDESCOM`.`Contacto` (`ID_Contacto`)
    ON DELETE CASCADE
    ON UPDATE CASCADE)
ENGINE = InnoDB;

CREATE INDEX `fk_Email_Contacto1_idx` ON `RIDESCOM`.`Email` (`Contacto_ID_Contacto` ASC) VISIBLE;


